import React from "react";
import styled from "styled-components";

const StyledBox = styled.div`
  width: 100px;
  height: 100px;
  margin: 10px;
  background-color: grey;
  color: black;
  border-radius: 5px;
`;

const Box = ({ rowId, columnId }) => {
  return (
    <StyledBox
      onClick={() => console.log("rowId: ", rowId, "columnId: ", columnId)}
    ></StyledBox>
  );
};

export default Box;
